 erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",ywc='Dimension',Bic='Dimension [height=',Osc='DirectionalTextHelper',Rsc='DockLayoutPanel',Ssc='DockLayoutPanel$Direction',Tsc='DockLayoutPanel$Direction;',Wsc='DockLayoutPanel$DockAnimateCommand',Usc='DockLayoutPanel$LayoutData',cpc='DomEvent',hpc='DomEvent$Type',gvc='Double',Cfc='EAST',jac='EEE, d MMM yyyy HH:mm:ss Z',qlc='EEE. dd MMM. yyyy HH:mm:ss',jbc='EEEE MMMM d',Kbc='EEEE, MMMM d',Gbc='EEEE, MMMM d, y',fbc='EEEE, y MMMM dd',K7b='EM',Hdc='EMPTY',Mdc='ENABLED',ccc='END',M7b='EX',xrc='ElementMapperImpl',yrc='ElementMapperImpl$FreeNode',Fbc='English',ooc='Enum',wbc='Etc/GMT',ybc='Etc/GMT+',xbc='Etc/GMT-',d8b='Event type',muc='Event$NativePreviewEvent',upc='EventBus',Enc='EventObject',Jnc='Exception',iec='Expecting version 6 from server, got ',a9b='F',zjc='F8834F07517EF3B7D02B9E845E5E1B88',F7b='FIXED',Gec='FLOAT',hjc='Fail: ',u9b='Feb',i9b='February',hvc='Float',Xsc='FlowPanel',wsc='FocusWidget',Chc='For input string: "',Y9b='Fri',R9b='Friday',r8b='GET',Hlc='GGD55XLBAH',lnc='GGD55XLBAK',Fmc='GGD55XLBBI',Tkc='GGD55XLBBJ',
